 a ser considerado aqui \u00e9 que todos os modelos apresentados foram obtidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"12680","type":"Paragraph"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"render_mode":"css","right_units":"screen","top_units":"screen"},"id":"12501","type":"BoxAnnotation"},{"attributes":{"data_source":{"id":"12329"},"glyph":{"id":"12330"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"12331"},"selection_glyph":null,"view":{"id":"12333"}},"id":"12332","type":"GlyphRenderer"},{"attributes":{"below":[{"id":"12307"}],"center":[{"id":"12310"},{"id":"12314"},{"id":"12352"},{"id":"12449"}],"left":[{"id":"12311"}],"plot_height":320,"renderers":[{"id":"12332"},{"id":"12357"},{"id":"12362"},{"id":"12390"},{"id":"12420"},{"id":"12457"}],"title":{"id":"12297"},"toolbar":{"id":"12322"},"x_range":{"id":"12299"},"x_scale":{"id":"12303"},"y_range":{"id":"12301"},"y_scale":{"id":"12305"}},"id":"12296","subtype":"Figure","type":"Plot"},{"attributes":{"text":"&lt;select id=\"16131\" onchange=\"location = this.value;\"&gt;&lt;option&gt;Selecione uma das Op\u00e7\u00f5es a Seguir&lt;/option&gt;&lt;option value=\"BiASiliaioi.html\"&gt;Municipio: Salvador&lt;/option&gt;&lt;option value=\"BiAFiiiaidiaitini.html\"&gt;Municipio: Feira de Santana&lt;/option&gt;&lt;option value=\"BiAVitiriaidioiqiiiti.html\"&gt;Municipio
